import React from "react";
import "./Watch.css"
const Watch = () => {
  return (
    <div className="Watch">
      <div className="row">
        <div className="video__watch left__bar" style={{flex:"0.6"}}>
         
        </div>

        <div className="video__watch right__bar" style={{flex:"0.4"}}>
                                             
        </div>
      </div>
    </div>
  );
};

export default Watch;
